                                                                        <td class="m_1766926067751749773editor-text m_1766926067751749773editor-text" align="left" valign="top" style="font-family:Arial,Verdana,Helvetica,sans-serif;font-size:14px;display:block;line-height:1.2;padding:10px 20px">
                                                                            <div></div>
                                                                            <div class="m_1766926067751749773gmail-text-container m_1766926067751749773gmail-galileo-ap-content-editor">
                                                                                <div>
                                                                                    <div align="justify" style="text-align:justify"><span style="font-size:18px">Dear Agent,</span></div>
                                                                                    <div align="justify" style="text-align:justify"><br></div>
                                                                                    <div align="justify" style="text-align:justify">Welcome to&nbsp;<span style="font-size:20px;font-family:&quot;Lobster Two&quot;,cursive;font-weight:bold">Soft</span><span style="font-size:20px;font-family:&quot;Lobster Two&quot;,cursive;font-weight:bold;color:rgb(245,86,7)">Pay</span><span style="font-size:20px;font-family:&quot;Lobster Two&quot;,cursive;font-weight:bold">Plus</span><span style="font-size:20px;font-weight:bold">!</span></div>
                                                                                    <div align="justify" style="text-align:justify"><br></div>
                                                                                    <ul style="padding:0px;margin:0px 0px 0px 40px">
                                                                                        <li style="padding:0px;margin:0px;line-height:1.2">How to setup an ACH Credit Account</li>
                                                                                        <li style="padding:0px;margin:0px;line-height:1.2">ACH documents Submission.</li>
                                                                                    </ul>
                                                                                    <div align="justify" style="text-align:justify"><br></div>
                                                                                    <div><span style="font-size:16px;color:rgb(11,83,148);font-weight:bold">You have signed up as a credit account. Please provide us following&nbsp;information by using our e-sign. It's an automated system.</span></div>
                                                                                    <div><br></div>
                                                                                    <div align="center" style="text-align:center"><span style="font-size:36px;text-decoration-line:underline;font-weight:bold">Checklist</span></div>
                                                                                    <div align="center" style="text-align:center"><a href="https://www.softpayplus.com/assets/Esign.mp4" style="color:rgb(247,37,5);font-weight:bold" target="_blank" data-saferedirecturl="https://www.google.com/url?q=https://www.softpayplus.com/assets/Esign.mp4&amp;source=gmail&amp;ust=1565227653965000&amp;usg=AFQjCNHxDmJhl14ota_QBzRhlVSwvD2Sfg">Click here or any of below buttons to "Learn how to" submit electronically e-Sign documents</a></div>
                                                                                    <div><br></div>
                                                                                    <div><span style="font-weight:bold">Submit the following documents</span></div>
                                                                                    <div><br></div>
                                                                                    <ol style="padding:0px;margin:0px 0px 0px 40px">
                                                                                        <li style="padding:0px;margin:0px;line-height:1.2;text-align:left"><a href="https://www.softpayplus.com/assets/Esign.mp4" style="color:rgb(0,0,0);font-weight:bold" target="_blank" data-saferedirecturl="https://www.google.com/url?q=https://www.softpayplus.com/assets/Esign.mp4&amp;source=gmail&amp;ust=1565227653965000&amp;usg=AFQjCNHxDmJhl14ota_QBzRhlVSwvD2Sfg">W9 Form</a><a href="https://www.softpayplus.com/assets/Esign.mp4" style="text-decoration-line:none;color:rgb(0,0,0);font-weight:bold" target="_blank" data-saferedirecturl="https://www.google.com/url?q=https://www.softpayplus.com/assets/Esign.mp4&amp;source=gmail&amp;ust=1565227653965000&amp;usg=AFQjCNHxDmJhl14ota_QBzRhlVSwvD2Sfg">&nbsp;&nbsp;</a>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;(Automated e-Sign available)</li>
                                                                                        <li style="padding:0px;margin:0px;line-height:1.2;text-align:left"><a href="https://www.softpayplus.com/assets/Esign.mp4" style="color:rgb(0,0,0);font-weight:bold" target="_blank" data-saferedirecturl="https://www.google.com/url?q=https://www.softpayplus.com/assets/Esign.mp4&amp;source=gmail&amp;ust=1565227653965000&amp;usg=AFQjCNHxDmJhl14ota_QBzRhlVSwvD2Sfg">Tax ID Form</a>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;(Upload required)</li>
                                                                                        <li style="padding:0px;margin:0px;line-height:1.2;text-align:left"><a href="https://www.softpayplus.com/assets/Esign.mp4" style="color:rgb(0,0,0);font-weight:bold" target="_blank" data-saferedirecturl="https://www.google.com/url?q=https://www.softpayplus.com/assets/Esign.mp4&amp;source=gmail&amp;ust=1565227653965000&amp;usg=AFQjCNHxDmJhl14ota_QBzRhlVSwvD2Sfg">Driver License</a>&nbsp;&nbsp;(Upload required)</li>
                                                                                        <li style="padding:0px;margin:0px;line-height:1.2;text-align:left"><a href="https://www.softpayplus.com/assets/Esign.mp4" style="color:rgb(0,0,0);font-weight:bold" target="_blank" data-saferedirecturl="https://www.google.com/url?q=https://www.softpayplus.com/assets/Esign.mp4&amp;source=gmail&amp;ust=1565227653965000&amp;usg=AFQjCNHxDmJhl14ota_QBzRhlVSwvD2Sfg">Void Check</a>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;(Upload required)</li>
                                                                                        <li style="padding:0px;margin:0px;line-height:1.2;text-align:left"><a href="https://www.softpayplus.com/assets/Esign.mp4" style="color:rgb(0,0,0);font-weight:bold" target="_blank" data-saferedirecturl="https://www.google.com/url?q=https://www.softpayplus.com/assets/Esign.mp4&amp;source=gmail&amp;ust=1565227653965000&amp;usg=AFQjCNHxDmJhl14ota_QBzRhlVSwvD2Sfg">ACH Form</a>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;( Automated e-Sign available)</li>
                                                                                    </ol>
                                                                                    <div><br></div>
                                                                                    <div><span style="font-weight:bold">Unless providing documents will remain as a&nbsp;</span><span style="font-weight:bold;text-decoration-line:underline">Zero Credit limit</span><span style="font-weight:bold">&nbsp;or&nbsp;</span><span style="font-weight:bold;text-decoration-line:underline">P</span><span style="font-weight:bold;text-decoration-line:underline">repaid Account.</span></div>
                                                                                    <div><span style="color:rgb(54,97,189);font-weight:bold">No problems, you can still use as a pay as you go by simply add funds to your account with Paypal account, credit card or debit card. (See below how-to video)</span></div>
                                                                                    <div><br></div>
                                                                                    <ul style="padding:0px;margin:0px 0px 0px 40px">
                                                                                        <li style="padding:0px;margin:0px;line-height:1.2;font-size:16px;text-align:left">Any question please give us a call at 703-256-3456 during our office hours M-F 9:30 am to 5:30 PM or email at&nbsp;<a href="mailto:ops@softpayplus.com" style="color:rgb(0,0,0);font-weight:bold" target="_blank">ops@softpayplus.com</a></li>
                                                                                    </ul>
                                                                                    <div><br></div>
                                                                                    <div><span style="font-size:13px;color:rgb(255,255,255)"></span><span style="font-size:16px;color:rgb(56,123,55);font-weight:bold">There is no difference between a Prepaid or an ACH Credit account offered by our services, Only difference is how would you making payment to us. You can continue activating and servicing the products offered on the&nbsp;</span><span style="font-size:18px;font-family:&quot;Lobster Two&quot;,cursive">Soft</span><span style="font-size:18px;font-family:&quot;Lobster Two&quot;,cursive;color:rgb(245,86,7)">Pay</span><span style="font-size:18px;font-family:&quot;Lobster Two&quot;,cursive">Plus</span><span style="font-size:20px;font-family:&quot;Lobster Two&quot;,cursive">&nbsp;</span><span style="font-size:16px;color:rgb(56,123,55);font-weight:bold">Portal</span><span style="font-size:16px;color:rgb(56,123,55)">.</span></div>
                                                                                    <div align="center" style="text-align:center"><span style="font-size:16px;font-weight:bold">&#65279;</span><span style="font-size:16px;color:rgb(34,34,34)">&#65279;</span></div>
                                                                                </div>
                                                                            </div>
                                                                        </td>
                                                                    </tr>
                                                                    </tbody>
                                                                </table>
                                                            </div>
                                                        </td>
